function Cyberbutton(name, tags) {
    return <button className="cybr-btn">
                {name.name}<span>_</span>
                <span className="cybr-btn__glitch">{name.any}</span>
                <span className="cybr-btn__tag">{tags.name}</span>
            </button>;
  }

  export default Cyberbutton;
